import React from 'react'

export default function AdminViewResults() {

  useEffect(() => {
    fetch("http://localhost:5000/getAllStudentResults", {
      method:"GET"
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data)
      })
  }, []);

  return (
    <div>
      Hi
    </div>
  )
}
